// admin/components/StatsCard.jsx
import React from "react";

export default function StatsCard({ title, value, icon, gradient, subtitle }) {
  return (
    <div className="col-md-3">
      <div className={`stats-card ${gradient}`}>
        <div className="d-flex justify-content-between align-items-center">
          <div>
            <h6 className="text-white-50 mb-2">{title}</h6>
            <h3>{value}</h3>
            <small>{subtitle}</small>
          </div>
          <i className={`${icon} fs-1 opacity-75`}></i>
        </div>
      </div>
    </div>
  );
}
